    return (
        <div>
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={{
                        width : '1900px',
                        height : '500px',
                        margin : '20px'
                    }}
                >

                </GoogleMap>
            </LoadScript>
        </div>
    )
}
